        id: 1,
        name: "Walailak Day",
        detail: "รายละเอียด.",
        place: "สนามกีฬา1",
        price: 200,
        compet_start: "2020-01-01",
        compet_end: "2020-01-01",
        start: "2020-01-01",
        end: "2020-01-01",
        pay_end: "2020-01-01",
        //gens: [Competition_Gen]
    },
    {
        id: 2,
        name: "Walailak Day2",
        detail: "รายละเอียด..",
        place: "สนามกีฬา2",
        price: 300,
        compet_start: "2020-01-01",
        compet_end: "2020-01-01",
        start: "2020-01-01",
        end: "2020-01-01",
        pay_end: "2020-01-01",
        //gens: [Competition_Gen]
    },
    {
        id: 3,
        name: "Walailak Day3",
        detail: "รายละเอียด...",
        place: "สนามกีฬา3",
        price: 600,
        compet_start: "2020-01-01",
        compet_end: "2020-01-01",
        start: "2020-01-01",
        end: "2020-01-01",
        pay_end: "2020-01-01",
        //gens: [Competition_Gen]
    }
]

function Competition() {
    return (
        <div style={divstyle}>
            {fakeData.map(prod => (
                <Link key={prod.id} href='/Competitions/[competitionId]' as={`/Competitions/${prod.id}`} >
                    <a>
                        <div>
                            {prod.name}
                        </div>
                    </a>
                </Link>

            ))}
        </div>
    )
}

const divstyle = {
    display: 'flex',
    justifyContent: 'center'
}
export default Competition;
